import { Fab, Grid , Typography, Box, Button, FormControlLabel, Switch} from '@mui/material'

import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom';
import { CcTextField } from '../Stocks';

// ICONS
import ClearIcon from '@mui/icons-material/Clear';

import LOGO  from '../../icons/user.png'

const Add_data = () => {
// Routes
  let NavS = useNavigate();

  // Status
  const [status,setStatus] = useState({
    "status" : "paid",
     "check" : true
  })

  return (
// Whole Container
    <Grid container padding={6} paddingTop={2} >

{/* Container para sa button paar may padding */}
      <Grid container padding={2}>
                      
        {/* Button cancel */}
        <Fab 
        color="primary"  
        aria-label="add" 
        onClick={e=>NavS("/Mainpage/Invoice")} 
        >
          <ClearIcon />
 
        </Fab>

      </Grid>

{/* Container for all components */}
      <Grid 
      container
      direction="row"
      justifyContent="center"
      alignItems="flex-start" 
      style={{
        backgroundColor:"white",
        border:"2px solid black",
        borderRadius: 5
      }}>

{/* CONTAINER FOR ICON LOGO */}
        <Grid item md={5} xs={12}>

          <Grid 
          container 
          padding={2}
          paddingTop={6}
          direction="row"
          justifyContent="center"
          alignItems="flex-start">

          {/* Picturebox */}
              <Box
              fixed
              component='img'
              marginY={2}

              sx={{
                width: 160,
                height: 160,
              }}
              src={LOGO} />

            <Grid md={12} padding={2}>

              <Typography variant='h6'> Purchase product:</Typography>
              <CcTextField  fullWidth multiline margin='normal' placeholder='please input the item ID here'/>

              <Typography variant='h6'> Date:</Typography>
              <CcTextField  fullWidth margin='normal'/>

{/* Toggle Button for payment status */}
              <FormControlLabel  
              label= {status.check ? "Paid" : "Pending"} 
              control={
              <Switch checked={status.check} onChange={()=> setStatus({...status, check: !status.check})}/>
              } />

            </Grid>

          </Grid>

          

        </Grid>

        {/* Components detailed */}
        <Grid container item md={7} xs={12} padding={2} paddingTop={6}>
          

            <Typography variant='h6'> Name:</Typography>
            <CcTextField  fullWidth margin='normal'/>

            <Typography variant='h6'> Email:</Typography>
            <CcTextField  fullWidth margin='normal'/>

            <Typography variant='h6'> Cellphone number:</Typography>
            <CcTextField  fullWidth margin='normal'/>

            <Typography variant='h6'> Address:</Typography>
            <CcTextField  fullWidth margin='normal' multiline/>       
            

        </Grid>

        {/* Button cancel */}

        <Grid
        item
        container
        md={12}
        padding={2}
        direction="row"
        justifyContent="center"
        alignItems="flex-start">

        {/* Add item button */}
          <Button variant='contained' size='large' style={{
            borderRadius: 50
          }}>
            Add item
          </Button>

        </Grid>

      </Grid>

    </Grid>
  )
}

export default Add_data
